import {useEffect, useRef, useState} from "react";
import {textIntro} from "./Intro";
import gsap from "gsap";
function Test() {
    let intro = useRef(null);
    const [music, setMusic] = useState([]);
    useEffect(() => {
        // textIntro(intro);
        const getData = () => {
            fetch("data.json", {
                    headers: {
                      "Content-Type": "application/json",
                      Accept: "application/json"
                    }
            })
            .then((response) => response.json())
            .then((data) => setMusic(data));

        };

getData();
gsap.from('.artists', {opacity: 0, duration: 10});
textIntro(intro);
}, []);


    return (
        <div>
            <h1 className ="intro" ref={(el) => (intro = el)}>My Awesome Music App!</h1>
           {music.map((m) => (
               <div key={m.id}>
               <h2 className="artists">Artist: {m.artistname}</h2>
               <h2 className="artists">Album: {m.album}</h2>
               <h2>Record Label: {m.label}</h2>
               <h2>Release Year: {m.year}</h2>
               <img src={m.albumImg} alt={m.artistname}/>
               <h4>Artist Bio:</h4>
                <p>{m.bio}</p>
               </div>
           ))} 
        </div>
    )
}

export default Test
